    2m bathymetry derived from multispectral IKONOS World View-2 satellite imagery of
    Swains Island, Territory of American Samoa, South Pacific, USA",nt"tracking_summary":
    {ntt"total": 1,ntt"recent": 1nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2015-09-26T23:32:36.565775",nt"name": "mosaic-of-2m-bathymetry-derived-from-multispectral-ikonos-world-view-2-satellite-imagery-of-swa",nt"isopen":
    false,nt"url": null,nt"notes": "Bathymetric data derived from a multipectral
    World View-2 satellite image mosaiced to provide near complete coverage of nearshore
    terrain around the islands. Bathymetry values shallower than ~20 m were derived
    by gauging the reletive attenuation of coastal, blue, green and yellow spectral
    radiance as a function of depth. A multiple linear regression analysis of coastal,
    blue, green and yellow band spectral values against depth determined the variables
    of y-intercept, coastal,blue, green and yellow slope values. Variables then used
    in multivariate slope intercept formula to derive depth. Variables were adjusted
    to improve the statistical accuracy and spatial coverage of the final derived bathymetry
    product. Digital image processing to derive depths conducted with the ENVI 4.8 software
    program while data editing and integration was performed using ArcGIS 10 This data
    set is for the shelf environment of Swains Island, American Samoa, South Pacific.",nt"license_title":
